//
func GetFileReader(img interface{ Base64Reader(l logger_.Logger)(io.Reader, string, error) }, l logger_.Logger) (io.Reader, error) {
	
	r, typ, err := img.Base64Reader(l)
	if err != nil {
		return nil, err_.Err( l, logIP, logI04 )
	}

	// обязательно вычитываем полностью base64
	// т.к., если у нас ошбка в base64, она оставалась бы здесь
	// а не перетекала бы в другие тесты
    buff := bytes.Buffer{}
    _, err = buff.ReadFrom(r)
    if err != nil {
        return nil, err_.Err( l, logIP, logI02 )
    }

	b := buff.Bytes()

	// так же проверяем изображение на корректность здесь
	// не простаскивая ошибки в тесты
	switch typ{
	case `image/png`, `image/jpg`:
		_, _, err = image.DecodeConfig(bytes.NewReader(b))
		if err != nil {
			return nil, err_.Err( l, logIP, typ, err)
		}
	case `image/svg+xml`:
	}


	return bytes.NewReader(b), nil
}
